{"nbformat":4,"nbformat_minor":0,"metadata":{"colab":{"provenance":[],"authorship_tag":"ABX9TyPspM7x2LNJL5nnR7Qz/mt2"},"kernelspec":{"name":"python3","display_name":"Python 3"},"language_info":{"name":"python"}},"cells":[{"cell_type":"markdown","source":["## 두피 및 머리카락 면적 기능\n","1. 이미지 로드 후 LAB 변환\n","2. KMeans를 적용하여 머리카락과 두피 분리\n","3. 각 비율 계산 및 결과"],"metadata":{"id":"8YI4kV-kXyGH"}},{"cell_type":"code","source":["import zipfile\n","import os\n","# 폴더가 존재하지 않으면 경로에 압축해제\n","if not os.path.exists('clust_img'):\n","    path = '/content/drive/MyDrive/dataset/clus_img.zip' # 폴더 경로\n","    f_zip = zipfile.ZipFile(path)\n","    f_zip.extractall('clust_img')\n","    f_zip.close()"],"metadata":{"id":"pmbBqT62vNQ4"},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":["필요한 라이브러리 임포트"],"metadata":{"id":"sOXllGJl1lIh"}},{"cell_type":"code","source":["import cv2\n","import numpy as np\n","import glob\n","import os\n","import matplotlib.pyplot as plt\n","from sklearn.cluster import KMeans"],"metadata":{"id":"0fQsc2B_1kBl"},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":["### K-Means 기반 두피 분석 시각화\n"],"metadata":{"id":"Qhu9FGr7Ykz9"}},{"cell_type":"markdown","source":["- LAB 색공간 변환 : K-Means의 정확도를 높이기 위해 LAB 색공간에서 클러스터링 수행\n","- 2개의 클러스터(머리카락 = 0, 두피 = 1)로 분류\n","- 밝기 기준 자동 조절 : 두피 & 머리카락 자동 식별\n","- 머리카락 및 두피 비율 분석 : 분류된 픽셀의 비율을 계산\n","- 원본과 분할된 이미지를 비교하여 출력\n"],"metadata":{"id":"EnjZjfiQD2Qh"}},{"cell_type":"code","source":["image_folder = \"/content/clust_img/clustering_img\"\n","image_files = glob.glob(os.path.join(image_folder, \"*.jpg\"))\n","\n","# 최대 9개의 이미지만 샘플링\n","num_samples = min(len(image_files), 9)\n","sample_images = image_files[:num_samples]\n","\n","# 서브플롯 설정 (3x6 = 9개 이미지 * 원본 & 세그먼트)\n","fig, axes = plt.subplots(3, 6, figsize=(15, 10))\n","\n","valid_count = 0  # 정상적으로 로드된 이미지 개수\n","\n","for img_path in sample_images:\n","    image = cv2.imread(img_path)\n","\n","    # 이미지 로드 실패 시 건너뛰기\n","    if image is None:\n","        continue\n","\n","    # 원본 이미지를 RGB로 변환 (OpenCV는 기본적으로 BGR)\n","    image_rgb = cv2.cvtColor(image, cv2.COLOR_BGR2RGB)\n","\n","    # LAB 색공간 변환\n","    image_lab = cv2.cvtColor(image, cv2.COLOR_BGR2LAB)\n","\n","    # 픽셀을 2D 배열로 변환\n","    pixels = image_lab.reshape((-1, 3))\n","\n","    # K-Means 클러스터링 (머리카락=0, 두피=1로 클러스터 2개 설정)\n","    kmeans = KMeans(n_clusters=2, random_state=42, n_init=10)\n","    labels = kmeans.fit_predict(pixels)\n","\n","    # 밝기 기준으로 두피(1), 머리카락(0)\n","    label_0_mean = np.mean(pixels[labels == 0])\n","    label_1_mean = np.mean(pixels[labels == 1])\n","\n","    if label_0_mean > label_1_mean:\n","        labels = np.where(labels == 0, 1, 0)  # 두피 = 1, 머리카락 = 0으로 변환\n","    else:\n","        labels = np.where(labels == 1, 1, 0)  # 반대 상황 처리\n","\n","    # 원본 형태로 복원\n","    segmented_image = labels.reshape(image.shape[:2])\n","\n","    # 머리카락과 두피 면적(픽셀 수) 계산\n","    hair_pixels = np.sum(segmented_image == 0)\n","    scalp_pixels = np.sum(segmented_image == 1)\n","    total_pixels = hair_pixels + scalp_pixels\n","\n","    hair_ratio = hair_pixels / total_pixels * 100  # 머리카락 비율 (%)\n","    scalp_ratio = scalp_pixels / total_pixels * 100  # 두피 비율 (%)\n","\n","    # 머리카락 & 두피 비율 출력\n","    print(f\"이미지 이름 : {os.path.basename(img_path)}\")\n","    print(f\"머리카락 비율: {hair_ratio:.2f}% ({hair_pixels}개)\")\n","    print(f\"두피 비율: {scalp_ratio:.2f}% ({scalp_pixels}개)\\n\")\n","\n","    # 원본 이미지 출력\n","    ax1 = axes[valid_count // 3, (valid_count % 3) * 2]\n","    ax1.imshow(image_rgb)\n","    ax1.set_title(f\"Original {valid_count+1}\")\n","    ax1.axis(\"off\")\n","\n","    # K-Means 결과 출력\n","    ax2 = axes[valid_count // 3, (valid_count % 3) * 2 + 1]\n","    ax2.imshow(segmented_image, cmap='binary')\n","    ax2.set_title(f\"Segmented {valid_count+1}\")\n","    ax2.axis(\"off\")\n","\n","    valid_count += 1\n","\n","    if valid_count >= 9:\n","        break\n","\n","plt.tight_layout()\n","plt.show()\n"],"metadata":{"colab":{"base_uri":"https://localhost:8080/","height":1000},"id":"aKhB5m0xvRjc","executionInfo":{"status":"ok","timestamp":1741581054946,"user_tz":-540,"elapsed":13800,"user":{"displayName":"장서영","userId":"05367406099894951616"}},"outputId":"85dbde49-3175-4ece-b6e4-f2b71f9ee6c9"},"execution_count":null,"outputs":[{"output_type":"stream","name":"stdout","text":["이미지 이름 : 1071_A2LEBJJDE00173R_1604931182344_3_TH.jpg\n","머리카락 비율: 7.43% (22815개)\n","두피 비율: 92.57% (284385개)\n","\n","이미지 이름 : 0844_A2LEBJJDE00067A_1605059327468_4_LH.jpg\n","머리카락 비율: 15.97% (49075개)\n","두피 비율: 84.03% (258125개)\n","\n","이미지 이름 : 2013_A2LEBJJDE00141O_1603008166327_5_RH.jpg\n","머리카락 비율: 18.03% (55373개)\n","두피 비율: 81.97% (251827개)\n","\n","이미지 이름 : 0703_A2LEBJJDE000774_1604020630032_4_LH.jpg\n","머리카락 비율: 7.65% (23490개)\n","두피 비율: 92.35% (283710개)\n","\n","이미지 이름 : 1940_A2LEBJJDE000307_1602650678501_5_RH.jpg\n","머리카락 비율: 7.71% (23681개)\n","두피 비율: 92.29% (283519개)\n","\n","이미지 이름 : 1719_A2LEBJJDE00138G_1602814642459_5_RH.jpg\n","머리카락 비율: 51.86% (159324개)\n","두피 비율: 48.14% (147876개)\n","\n","이미지 이름 : 1195_A2LEBJJDE00197M_1604568129545_2_TH.jpg\n","머리카락 비율: 11.02% (33856개)\n","두피 비율: 88.98% (273344개)\n","\n","이미지 이름 : 5030_A2LEBJJDE00186Z_1606294570567_4_LH.jpg\n","머리카락 비율: 19.77% (60744개)\n","두피 비율: 80.23% (246456개)\n","\n","이미지 이름 : 1142_A2LEBJJDE00024K_1605944053798_3_TH.jpg\n","머리카락 비율: 29.15% (89547개)\n","두피 비율: 70.85% (217653개)\n","\n"]},{"output_type":"display_data","data":{"text/plain":["<Figure size 1500x1000 with 18 Axes>"],"image/png":"\n"},"metadata":{}}]},{"cell_type":"markdown","source":["#결과\n","- 이미지마다 두피 색상이 달라 다수의 데이터 통합이 어려워 각 이미지 내에서 K-Means 학습 진행\n","- 테스트 재사용은 어려우나 단일 이미지 실시간 처리에 적합한 미시적 접근 방식 사용\n","\n","- K-Means 클러스터링을 적용하여 두피와 머리카락을 일정 수준 이상으로 분류 가능\n","- 밝기를 기준으로 클러스터를 자동 조정하는 방법이 유효함"],"metadata":{"id":"ogaOo5WoEZIZ"}},{"cell_type":"markdown","source":["#한계점\n","- 비지도 학습 기반으로 동작하여 일부 이미지에서는 두피와 머리카락의 분리가 정확하지 않은 경우도 존재\n","- 클러스터 개수를 고정한 방식으로 더 정교한 분류를 위해 다른 모델 적용 고려(FAST-CNN, U-NET 등)"],"metadata":{"id":"8VwFtbs1FxKp"}}]}